import React from 'react';


export default function Logo() {
    return(
        <div className='container'>
            <h4 className='flex'>Quantum Quack Molly</h4>
            <img className="card-img quack" src="images/quack.jpg" alt="Card image cap"/>
        </div>
    );
}
